import React from "react";
import { DatePicker, Space } from "antd";

const { RangePicker } = DatePicker;

export const Dates = () => {
  return (
    <Space direction="vertical" size={12}>
      <RangePicker
        showTime
        onChange={(date, dateString) => console.log(date, dateString)}
      />
    </Space>
  );
};
